int currEnd = 0;
int currDir = 1;

bool game_on = false;

bool has_cleared = false;

int main(void)
{
	// initialize location and direction of rectangles(not shown)
	/* set front pixel buffer to start of FPGA On-chip memory */
	*(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
										// back buffer
	/* now, swap the front/back buffers, to set the front buffer location */
	wait_for_vsync();
	/* initialize a pointer to the pixel buffer, used by drawing functions */
	pixel_buffer_start = *pixel_ctrl_ptr;
	clear_screen(); // pixel_buffer_start points to the pixel buffer
	/* set back pixel buffer to start of SDRAM memory */
	*(pixel_ctrl_ptr + 1) = 0xC0000000;

	// declare our variables!
	int to_clear_ball_x = ball_X_center;

	/// BOX DATA ///
	int box_X_center[NUM_BOXES], box_Y_center[NUM_BOXES];
	bool box_emerald[NUM_BOXES];

	// to be cleared - holds the configuration from one ago.
	int to_clear_x[NUM_BOXES], to_clear_y[NUM_BOXES];
	bool box_emerald_to_clear[NUM_BOXES];

	int currHead = 0;
	int currEnd = NUM_BOXES - 1;

	printf("starting reset \n");
	new_game_reset:
		// SET BALL DATA
		to_clear_ball_x = ball_X_center;
		ball_X_center = CENTER_X;
		//score reset
		score = 0;

		initialize_path(box_X_center, box_Y_center, to_clear_x, to_clear_y, box_emerald, box_emerald_to_clear);

		currHead = 0;
		currEnd = NUM_BOXES - 1;
		game_on = false;

		clear_screen();
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
		clear_screen();
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
	
	printf("New game time! \n");
	new_game_wait:
		//game only starts when the enter key is pressed
		displayStartScreen();
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);

		pollxKey();
		if (game_on) {
			goto play_game;
		}
		//printf("hello!\n");
		goto new_game_wait;

    play_game:
		fflush(stdout);

		/* Erase any boxes and lines that were drawn in the last iteration */
		//clear_screen(); // pixel_buffer_start points to the pixel buffer
		if (!has_cleared) {
			printf("Clearing once \n");
			clear_screen();
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			printf("Clearing twice \n");
			clear_screen();
			printf("Back to the original");
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			has_cleared = true;
		}

		clear_partial(to_clear_x, to_clear_y, box_emerald_to_clear);

		clear_ball(to_clear_ball_x);

		update_path(box_X_center, box_Y_center, to_clear_x, to_clear_y, box_emerald, box_emerald_to_clear, &currHead, &currEnd);

		if (detect_game_over(box_X_center, box_Y_center, currHead, ball_X_center)) {
			printf("Game Over! \n");
			has_cleared = false;
			goto end_screen;
		}

		detect_emerald(box_X_center, box_Y_center, currHead, ball_X_center, box_emerald);

		draw_score();

		draw_path(box_X_center, box_Y_center, box_emerald, false, BLUE);

		pollSpaceKey();

		to_clear_ball_x = ball_X_center;

		ball_X_center += ballMovement;

		draw_ball(ball_X_center);

		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

		goto play_game;



	end_screen:
		fflush(stdout);
		if (!has_cleared) {
			clear_screen();
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			clear_screen();
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			has_cleared = true;
		}

		displayEndScreen();
		//display the score on the end Screen
		draw_score ();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

		pollxKey();

		// check if we want to reset
		if (!game_on) {
			clear_screen();
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			clear_screen();
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			has_cleared = false;

			goto new_game_reset;
		}
		goto end_screen;
}

