void update_path(int *array_x_box, int *array_y_box, int *to_clear_x, int *to_clear_y, bool* box_emerald, bool* box_emerald_to_clear, int *currHead, int *currEnd) {
	for (int i = 0; i < NUM_BOXES; i++) {
		to_clear_x[i] = array_x_box[i];
		to_clear_y[i] = array_y_box[i];
        box_emerald_to_clear[i] = box_emerald[i];
		array_y_box[i] += 1;
	}
	if (array_y_box[*currHead] >= 205) {
		// adding a new end block while removing our head block
		// get our random direction!
		int leftOrRight = rand()%2;
		if (score > 50) {
			int randomize = rand()%3;
			if (randomize != 0) {
				leftOrRight = (-1) * currDir;
			}
		}
		
		if (leftOrRight == 0) {
			leftOrRight = -1;
		}
		// quick check -> make sure we stay within bounds
		if (array_x_box[*currEnd] > 250) {
			leftOrRight = -1;
		} else if (array_x_box[*currEnd] < 70) {
			leftOrRight = 1;
		}
		// update with our new end block
		array_x_box[*currHead] = array_x_box[*currEnd] + leftOrRight * SQUARE_SIZE;
		array_y_box[*currHead] = array_y_box[*currEnd] - SQUARE_SIZE;

        // check if we want to add an emerald here!
        int generate_em = rand()%10;
        if (generate_em == 0) {
            box_emerald[*currHead] = true;
        } else {
            box_emerald[*currHead] = false;
        }
		// updating our 'queue' with a new head and end
		*currHead = (*currHead + 1) % NUM_BOXES;
		*currEnd = (*currEnd + 1) % NUM_BOXES;
		currDir = leftOrRight;
	}
}


void initialize_path(int *array_x_box, int *array_y_box, int *to_clear_x, int *to_clear_y, bool* box_emerald, bool* box_emerald_to_clear) {
	array_x_box[0] = BASE_X_BOX;
	array_y_box[0] = BASE_Y_BOX;
	// placeholders for our clearing function
	to_clear_x[0] = BOX_PLACEHOLDER;
	to_clear_y[0] = BOX_PLACEHOLDER;
    box_emerald[0] = false;
    box_emerald_to_clear[0] = false;

	array_x_box[0] = BASE_X_BOX;
	array_y_box[0] = BASE_Y_BOX;
	// placeholders for our clearing function
	to_clear_x[0] = BOX_PLACEHOLDER;
	to_clear_y[0] = BOX_PLACEHOLDER;
    box_emerald[0] = false;
    box_emerald_to_clear[0] = false;

	for (int i = 1; i < 4; i++) {
		// update our next box's position based on the preceeding box
		array_x_box[i] = array_x_box[i-1] + SQUARE_SIZE;
		array_y_box[i] = array_y_box[i-1] - SQUARE_SIZE;
		// placeholders for our clearing function
		to_clear_x[i] = BOX_PLACEHOLDER;
		to_clear_y[i] = BOX_PLACEHOLDER;
	}

	for (int i = 4; i < NUM_BOXES; i++) {
		// determine whether to go left or right
		// 0 is left, 1 is right
		int leftOrRight = rand()%2;
		if (leftOrRight == 0) {
			leftOrRight = -1;
		}
        // quick check -> make sure we stay within bounds
		if (array_x_box[i] > 300) {
			leftOrRight = -1;
		} else if (array_x_box[i] < 40) {
			leftOrRight = 1;
		}

		// update our next box's position based on the preceeding box
		array_x_box[i] = array_x_box[i-1] + leftOrRight * SQUARE_SIZE;
		array_y_box[i] = array_y_box[i-1] - SQUARE_SIZE;
		// placeholders for our clearing function
		to_clear_x[i] = BOX_PLACEHOLDER;
		to_clear_y[i] = BOX_PLACEHOLDER;

        // emerald generation check!
        int generate_em = rand()%10;
        if (generate_em == 0) {
            box_emerald[i] = true;
            //printf("emerald gen\n");
        } else {
            box_emerald[i] = false;
        }
        box_emerald_to_clear[i] = 0;
		if (i == NUM_BOXES - 1) {
			currDir = leftOrRight;
		}
	}
}

//this function draws a line
void draw_line(int x0, int y0, int x1, int y1, short int line_color){
	bool is_steep = (abs(y1-y0) > abs(x1-x0));
	int y_step;

	//if line is steep, then we theoretically swap the x and y values and apply bresenham's algo
	if (is_steep){
		swap (&x0, &y0);
		swap (&x1, &y1);
	}
	//if the line is going upward, flip it so the slope is negative
	if (x0 > x1){
		swap (&x0, &x1);
		swap (&y0, &y1);
	}

	//find corresponding deltax and deltay
	int deltax = x1 - x0;
	int deltay = abs(y1-y0);
	int error = -(deltax/2);
	int y = y0;

	//setting ideal step
	if (y0 < y1){
		y_step = 1;
	}else{
		y_step = -1;
	}

	//for each x value ranging from x0-x1 (horizontally)
	for (int x = x0; x <= x1; x++){
		//if the line is steep, swap the x and y values when filling in the pixel
		if (is_steep){
			draw_pixel(y, x, line_color);
		}else{
			draw_pixel(x, y, line_color);
		}

		//error calculated to decide whether or not to increment each y-value
		//error takes into account relative width and height of line in deciding how often y should be incremented
		error = error + deltay;
		if (error >= 0){
			y = y + y_step;
			error = error - deltax;
		}

	}
}

//the VGA controller redraws the screen every 1/60th of a second, so we make sure that we change
//the screen only after that 1/60th mark. So we syncronize with the vga controller.
void wait_for_vsync(){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	int status;

	//launch the swap process
	*pixel_ctrl_ptr = 1; 	//write 1 to buffer register
	//poll the status bit
	status = *(pixel_ctrl_ptr + 3); //status register

	while ((status & 0x01)!= 0){
		status = *(pixel_ctrl_ptr + 3);
	}
	//done swap, S bit is now a 0

}

void draw_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

//helper function swap that swaps 2 entities
void swap (int *elem1, int *elem2){
	int temp = *elem1;
	*elem1 =   *elem2;
	*elem2 = temp;
}

void clear_screen(){
	//looping through all the pixels and changing their colour to black
	for (int x = 0; x < RESOLUTION_X; x++){
		for (int y = 0; y < RESOLUTION_Y; y++){
			draw_pixel(x, y, WHITE);
		}

	}
}

void draw_box(int x_center, int y_center, short int colour){
	for (int i = 0; i < SQUARE_SIZE; i++) {

		// set our sides
		int x_left = x_center - SQUARE_SIZE + i;
		int y_left = y_center + i;
		int x_bot = x_center + i;
		int y_bot = y_center - SQUARE_SIZE + i;

		// check if this is in bounds!
		y_left = (y_left < BOX_LEN) ? BOX_LEN : y_left;

		if (y_bot > BOX_LEN) {
			draw_line(x_left, y_left, x_bot, y_bot, colour);
		}

	}
}

