// subroutine for plotting text on the screen
void VGA_text(int x, int y, char *text_ptr) {
    /* assume that the text string fits on one line */
    int offset = (y << 7) + x;
	
    while (*(text_ptr)) // while it hasn't reach the null-terminating char in the string
    {
		//printf("%c\n", *text_ptr);
        // write to the character buffer
        *(character_buffer + offset) = *(text_ptr);
        ++text_ptr;
        ++offset;
    }
}

void pollSpaceKey(int ballMovement){
	int PS2_data = *(PS2_ptr);			//reading the DATA register
	int RVALID = (PS2_data & 0x8000);	//extract the RVALID bit
	int key_pressed = PS2_data & 0xFF;	//the DATA itself

	int previousKey = 0;
	int currentKey = PS2_data & 0xFF;

	if (RVALID != 0)
	{

		while (previousKey == 41 && currentKey != 240){
			PS2_data = *(PS2_ptr);
			int key_pressed = PS2_data & 0xFF;
			//we know the space key has been pressed but not yet released
			previousKey = currentKey;
			currentKey = key_pressed;
		}
		//printf ("currentKey: %d\n", currentKey);

		//read the next key
		PS2_data = *(PS2_ptr);
		key_pressed = PS2_data & 0xFF;

		if (key_pressed == 41 && currentKey == 240){
			//space key was successfull released
			score += 1;
			changeBallDirection();

		}
	}
}

void changeBallDirection(){

	if (ballMovement == 1){
		ballMovement = -1;
	}else if (ballMovement == -1){
		ballMovement = 1;
	}else{
		ballMovement = 0;
	}
}

// true for gg, false for continue!
bool detect_game_over(int *x_centers, int *y_centers, int currHead, int ball_X_center) {
	// In this case, the currHead is ABOVE the ball's position
	// i.e. the ball is on one block and is therefore constrained to the bottom 'triangle'
	if (y_centers[currHead] < BASE_Y_BOX) {
		int diff = SQUARE_SIZE - (BASE_Y_BOX - y_centers[currHead]);
		int left_bound = x_centers[currHead] - diff;
		int right_bound = x_centers[currHead] + diff;
		if ((ball_X_center < left_bound) || (ball_X_center > right_bound)) {
			return true;
		} else {
			return false;
		}
	} else {
		// in this case, the ball is above the center of the current head
		// therefore, it clips between two boxes
		// there are two cases for this -> the top box is to the left OR the top box is to the right
		// get the index of the head before
		// check -> if the currHead is at the end, we get 0 Else, we get 1
		int preHead = (currHead == NUM_BOXES - 1) ? 0 : currHead + 1;

		// We do SQUARE_SIZE - (diff) because our edge distance scales inversely
		// the further from the center we are, the closer to the center the bounds are
		// in this case, the box leans left!
		if (x_centers[preHead] < x_centers[currHead]) {
			// as this box leans left, the currHead box determines the right bound while the preHead determines left bound
			// let's get the difference between our y and our currHead to determine the right bound
			int right_diff = SQUARE_SIZE - (y_centers[currHead] - BASE_Y_BOX);
			int right_bound = x_centers[currHead] + right_diff;
			// Difference between our ball y and the preHead y is the left bound
			int left_diff = SQUARE_SIZE - (BASE_Y_BOX - y_centers[preHead]);
			int left_bound = x_centers[preHead] - left_diff;
			if ((ball_X_center < left_bound) || (ball_X_center > right_bound)) {
				return true;
			} else {
				return false;
			}
		} else {
			// box leans right!
			// therefore, currHead box determines left bound, prehead determines right bound
			int right_diff = SQUARE_SIZE - (BASE_Y_BOX - y_centers[preHead]);
			int right_bound = x_centers[preHead] + right_diff;
			// Difference between our ball y and the currHead y is the left bound
			int left_diff = SQUARE_SIZE - (y_centers[preHead] - BASE_Y_BOX);
			int left_bound = x_centers[currHead] - left_diff;
			if ((ball_X_center < left_bound) || (ball_X_center > right_bound)) {
				return true;
			} else {
				return false;
			}
		}
	}
}

void detect_emerald(int *x_centers, int *y_centers, int currHead, int ball_X_center, bool *box_emerald) {
	// we check for two boxes
	// first is the currHead, then the one directly above the currHead
	// if the emerald ever hits, we can remove it and iterate point!
	int preHead = (currHead == NUM_BOXES - 1) ? 0 : currHead + 1;
	// check that the emerald is in the hitbox
	// for this check, we check if the dead center of the emerald is within our ball's square-shaped hitbox
	// our ball has a radius of 6, so let's make our hitbox 10 x 10
	if (box_emerald[currHead]) {
		// our Y check
		if ((y_centers[currHead] < (BASE_Y_BOX + 5)) && (y_centers[currHead] > (BASE_Y_BOX - 5))) {
			if ((x_centers[currHead] < (ball_X_center + 5)) && (x_centers[currHead] > (ball_X_center - 5))) {
				// iterate points
				score += 2;
				// make the box_emerald disappear!
				box_emerald[currHead] = false;
				//printf("hit \n");
			}
		}
	}
	if (box_emerald[preHead]) {
		// our Y check
		if ((y_centers[preHead] < (BASE_Y_BOX + 5)) && (y_centers[preHead] > (BASE_Y_BOX - 5))) {
			if ((x_centers[preHead] < (ball_X_center + 5)) && (x_centers[preHead] > (ball_X_center - 5))) {
				// iterate points
				score += 2;
				// make the box_emerald disappear!
				box_emerald[preHead] = false;
				//printf("hit \n");
			}
		}
	}
}

void draw_score() {
	char score_string[40];
	int hundreds = score / 100;
	int tens = (score - hundreds * 100) / 10;
	int ones = score - hundreds * 100 - tens * 10;
	if (hundreds != 0) {
		score_string[0] = hundreds + '0';
	} else {
		score_string[0] = ' ';
	}
	if (hundreds == 0 && tens == 0) {
		score_string[1] = ' ';
	} else {
		score_string[1] = tens + '0';
	}
	score_string[2] = ones + '0';
	score_string[3] = '\0';
	for (int i = 0; i < 18; i++) {
		draw_line(280, 0 + i, 315, 0 + i, BLACK);
	}
	VGA_text(328, -1, "SCORE");
	VGA_text(330, 1, score_string);
}

void draw_image(int x0, int y0, int drawOrErase){
	//printf("boutta draw \n");
	for (int i = 0; i < RESOLUTION_Y; i++){
		for (int j = 0; j < RESOLUTION_X; j++){
			if (drawOrErase == 1){
				//draw
				//printf("draw the fun!\n");
				draw_pixel(x0+j, y0+i, startScreenArray[i][j]);
			}else if (drawOrErase == 0){
				//erase
				draw_pixel(x0+j, y0+i, WHITE);
			} else if (drawOrErase == -1) {
				draw_pixel(x0+j, y0+i, endScreenArray[i][j]);
			}
		}
	}
}
	